import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import '../styles/navigation.css'

class Navigation extends Component {
  render() {
  		return (
			<Container fluid={true} style={navigationStyle}>
				<Row className="justify-content-md-center">
					<Col />
					<Col>
						<h1 style={websiteHeaderStyle}><b>Nigel Haney</b></h1>
					</Col>
					<Col className="d-flex justify-content-end">
						<div><a href="https://github.com/nhaney" className="fa fa-github" /></div>
						<div height="30px" width="30px"><a href="https://www.linkedin.com/in/nigel-haney/" className="fa fa-linkedin" /></div>
						<div><a href="https://www.youtube.com/channel/UC8kot0jObfGnY28lYXmQugw" className="fa fa-youtube" /></div>
					</Col>
				</Row>
				<Navbar style={{margin:"0px"}} className="justify-content-md-center" sticky="top" bg="dark" variant="dark">
					<Nav>
						<Nav.Link href="/" style={navStyle}>Home</Nav.Link>
						<Nav.Link href="/about" style={navStyle}>About</Nav.Link>
						<Nav.Link href="/blog" style={navStyle}>Blog</Nav.Link>
						<Nav.Link href="/experience" style={navStyle}>Experience</Nav.Link>
						<Nav.Link href="/games" style={navStyle}>Games</Nav.Link>
					</Nav>
				</Navbar>
			</Container>	
  		);
  	}
}

const navStyle = {
	paddingLeft: "30px",
	paddingRight: "30px"
}

const navigationStyle = {
	backgroundColor: '#f4f4f4'
}

const websiteHeaderStyle = {
	"textAlign": "center",
	"fontFamily":"Helvetica",
	"fontSize":"60px",
	"color":"#353B41"
}

const websiteLogoStyle = {

}

export default Navigation;
